[[package]]
category = "main"
description = "Bash tab completion for argparse"
name = "argcomplete"
optional = false
python-versions = "*"
version = "1.11.1"

[package.dependencies]
[package.dependencies.importlib-metadata]
python = ">=3.6,<3.7"
version = ">=0.23,<2"

[package.extras]
test = ["coverage", "flake8", "pexpect", "wheel"]

[[package]]
category = "main"
description = "A aws psycopg2 package from psycopg2."
name = "aws-psycopg2"
optional = false
python-versions = "*"
version = "1.2.1"

[[package]]
category = "main"
description = "The AWS SDK for Python"
name = "boto3"
optional = false
python-versions = "*"
version = "1.14.5"

[package.dependencies]
botocore = ">=1.17.5,<1.18.0"
jmespath = ">=0.7.1,<1.0.0"
s3transfer = ">=0.3.0,<0.4.0"

[[package]]
category = "dev"
description = "Type annotations for boto3 1.14.5, generated by mypy-boto3-buider 2.2.0"
name = "boto3-stubs"
optional = false
python-versions = ">=3.6"
version = "1.14.5.0"

[package.dependencies]
mypy-boto3 = "1.14.5.0"

[package.dependencies.mypy-boto3-logs]
optional = true
version = "1.14.5.0"

[package.dependencies.mypy-boto3-s3]
optional = true
version = "1.14.5.0"

[package.dependencies.typing-extensions]
python = "<3.8"
version = "*"

